import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { Routes, Route, Redirect } from 'react-router-dom';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <Routes>
      <Route exact path="/" component={App} />
      <Route path="homework-1.1" component={App}/>
      <Route path="homework-1.2" component={App}/>
      <Route path="homework-1.3" component={App}/>
      <Route path="homework-1.4" component={App}/>
      <Route path="homework-2.1" component={App}/>
      <Route path="homework-2.2" component={App}/>
      <Route path="homework-3.1" component={App}/>
      <Route path="homework-3.2" component={App}/>
      <Route path="homework-4" component={App}/>
      <Route path="homework-6" component={App}/>
      <Route path="homework-8" component={App}/>
    </Routes>
);

// If you want to start measuring performance in your app, pass a function
